-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">\r\n            –î–ª—è\r\n            –≤–æ–∑–¥—É—Ö–∞ —Ñ–æ—Ä–º—É–ª—ã –º–æ–≥—É—Ç –±—ã—Ç—å —É–ø—Ä–æ—â–µ–Ω—ã: –ø—Ä–∏ –∫–æ—Ä–∏–¥–æ—Ä–Ω–æ–º —Ä–∞—Å–ø–æ–ª–æ–∂–µ–Ω–∏–∏ —Ç—Ä—É–± –≤ –ø—É—á–∫–µ<o:p></o:p></span></p>\r\n\r\n    <p class=\"MsoNormal\" align=\"center\" style=\"margin-left:-42.55pt;text-align:center;\r\ntext-indent:21.25pt\"><span style=\"font-size:14.0pt;line-height:115%;font-family:\r\n&quot;Cambria Math&quot;,&quot;serif&quot;;mso-bidi-font-family:&quot;Cambria Math&quot;\">ùëÅùë¢</span><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">=0,21‚àô</span><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Cambria Math&quot;,&quot;serif&quot;;\r\nmso-bidi-font-family:&quot;Cambria Math&quot;\">ùëÖùëí</span><sup><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">0,65</span></sup><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">;<o:p></o:p></span></p>\r\n\r\n    <p class=\"MsoNormal\" style=\"margin-left:-42.55pt;text-align:justify;text-indent:\r\n21.25pt\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">\r\n            –ø—Ä–∏\r\n            —à–∞—Ö–º–∞—Ç–Ω–æ–º —Ä–∞—Å–ø–æ–ª–æ–∂–µ–Ω–∏–∏ —Ç—Ä—É–± –≤ –ø—É—á–∫–µ<o:p></o:p></span></p>\r\n\r\n    <p class=\"MsoNormal\" align=\"center\" style=\"margin-left:-42.55pt;text-align:center;\r\ntext-indent:21.25pt\"><span style=\"font-size:14.0pt;line-height:115%;font-family:\r\n&quot;Cambria Math&quot;,&quot;serif&quot;;mso-bidi-font-family:&quot;Cambria Math&quot;\">ùëÅùë¢</span><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">=0,37‚àô</span><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Cambria Math&quot;,&quot;serif&quot;;\r\nmso-bid