   <p class=\"MsoNormal\" style=\"margin-left:-42.55pt;text-align:justify;text-indent:\r\n21.25pt\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">\r\n            –ü—Ä–∏–≤–µ–¥–µ–Ω–Ω—ã–µ\r\n            —Ñ–æ—Ä–º—É–ª—ã –ø–æ–∑–≤–æ–ª—è—é—Ç –æ–ø—Ä–µ–¥–µ–ª—è—Ç—å —Å—Ä–µ–¥–Ω–∏–µ –∑–Ω–∞—á–µ–Ω–∏—è –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç–æ–≤ —Ç–µ–ø–ª–æ–æ—Ç–¥–∞—á–∏ –ø—Ä–∏\r\n            –Ω–∞—Ç–µ–∫–∞–Ω–∏–∏ –ø–æ—Ç–æ–∫–∞ –ø–æ–¥ —É–≥–ª–æ–º 90¬∞ –∫ –æ—Å—è–º —Ç—Ä—É–±, —Ä–∞—Å–ø–æ–ª–æ–∂–µ–Ω–Ω—ã—Ö –≤ –ø—É—á–∫–µ. –ï—Å–ª–∏ –ø–æ—Ç–æ–∫\r\n            –Ω–∞—Ç–µ–∫–∞–µ—Ç –ø–æ–¥ –Ω–µ–∫–æ—Ç–æ—Ä—ã–º —É–≥–ª–æ–º œÜ –∫ –æ—Å–∏ —Ç—Ä—É–±—ã, —Ç–æ –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –≤–≤–æ–¥–∏—Ç—å –ø–æ–ø—Ä–∞–≤–æ—á–Ω—ã–π\r\n            –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç Œµ<sub>œÜ</sub>, –∑–Ω–∞—á–µ–Ω–∏—è –∫–æ—Ç–æ—Ä–æ–≥–æ –ø—Ä–∏–≤–µ–¥–µ–Ω—ã –≤ —Ç–∞–±–ª. 2.<o:p></o:p></span></p>\r\n\r\n    <p class=\"Default\" style=\"margin-left:-42.55pt;text-indent:21.25pt\"><span style=\"font-size:14.0pt\">\r\n            –ü—Ä–∏ —ç—Ç–æ–º —Ä–∞—Å—á–µ—Ç–Ω–∞—è —Ñ–æ—Ä–º—É–ª–∞ –¥–ª—è Œ±œÜ, –í—Ç/(–º2*–ö), –∏–º–µ–µ—Ç\r\n            –≤–∏–¥ <o:p></o:p></span></p>\r\n\r\n    <p class=\"MsoNormal\" align=\"center\" style=\"margin-left:-42.55pt;text-align:center;\r\ntext-indent:21.25pt\"><span style=\"font-size:14.0pt;line-height:115%;font-family:\r\n&quot;Cambria Math&quot;,&quot;serif&quot;;mso-bidi-font-family:&quot;Cambria Math&quot;\">ùõÇ<sub>ùõó</sub></span><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">=</span><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Cambria Math&quot;,&quot;serif&quot;;\r\nmso-bidi-font-family:&quot;Cambria Math&quot;\">ùõÇ<sub>ùüóùüé</sub></span><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">‚àô</span><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Cambria Math&quot;,&quot;serif&quot;;\r\nmso-bidi-font-family:&quot;Cambria Math